        {% for produit in produits %}
            <div class=\"col\">
                <div class=\"card shadow-sm\">
                    <img src=\"{{ asset(produit.imageProduit) }}\" class=\"card-img-top\" alt=\"{{ produit.i }}\" style=\"height: 450px; object-fit: cover\">

                    <div class=\"card-body\">
                        <h5 class=\"card-title\">{{ produit.libelleProduit }}</h5>
                        <p class=\"card-text\">{{ produit.prixProduit }} €</p>

                        <a href=\"{{ path('cart_add', {id: produit.id}) }}\" class=\"btn btn-primary\">Ajouter au panier</a>
                    </div>
                </div>
            </div>
        {% endfor %}
    </div>

